CREATE TABLE `reporte` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `direccion_completa` varchar(255) DEFAULT NULL,
  `direccion_id` varchar(255) DEFAULT NULL,
  `lat` double DEFAULT NULL,
  `long` double DEFAULT NULL,
  `estado` varchar(255) NOT NULL,
  `horas` double DEFAULT NULL,
  `ip` varchar(255) NOT NULL,
  `fecha` datetime NOT NULL,
  `zona_id` int(10) unsigned DEFAULT NULL,
  `tweet_id` bigint(20) unsigned DEFAULT NULL,
  `tweet` text,
  `fruta` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `anulado` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `puntaje` double unsigned NOT NULL DEFAULT '1',
  `device` text,
  `fingerprint` text,
  `user_agent` text,
  `impreciso` tinyint(3) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `ix_reporte_ubicacion` (`long`,`lat`,`fecha`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;


CREATE TABLE `tile` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `x` int(11) NOT NULL,
  `y` int(11) NOT NULL,
  `z` int(11) NOT NULL,
  `actualizar` tinyint(3) unsigned NOT NULL DEFAULT '1',
  `bound_sw_lat` double DEFAULT NULL,
  `bound_sw_long` double DEFAULT NULL,
  `bound_ne_lat` double DEFAULT NULL,
  `bound_ne_long` double DEFAULT NULL,
  `timestamp` int(11) DEFAULT NULL,
  `fecha_update_reportes` datetime DEFAULT NULL,
  `actualizar_reportes` tinyint(3) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `ix_tile_bounds` (`bound_sw_long`,`bound_ne_long`,`bound_sw_lat`,`bound_ne_lat`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;


CREATE TABLE `tweet` (
  `id` bigint(20) unsigned NOT NULL,
  `text` varchar(255) CHARACTER SET utf8 NOT NULL,
  `json` text CHARACTER SET utf8 NOT NULL,
  `fecha` datetime NOT NULL,
  `zona_id` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


CREATE TABLE `zona` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nombre` varchar(255) NOT NULL,
  `poligono` longtext,
  `lat` double DEFAULT NULL,
  `long` double DEFAULT NULL,
  `slug` varchar(255) DEFAULT NULL,
  `estado` double unsigned DEFAULT '1',
  `estado_ultimo_tweet` double unsigned DEFAULT NULL,
  `civilizacion` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `bound_sw_long` double DEFAULT NULL,
  `bound_sw_lat` double DEFAULT NULL,
  `bound_ne_long` double DEFAULT NULL,
  `bound_ne_lat` double DEFAULT NULL,
  `fecha_update_reportes` datetime DEFAULT NULL,
  `seleccionable` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `fecha_update_estado` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;




CREATE TABLE `aliaszona` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `zona_id` int(10) unsigned NOT NULL,
  `nombre` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;





